"use strict";
const currentScript = document.currentScript;
const fileScriptAttribute = currentScript.getAttribute('f');
/*const fileScriptAttribute = `goals.json`;*/
/*const centrScriptAttribute = currentScript.getAttribute('c');*/
const centrScriptAttribute = '1';
var pidAttribute = currentScript.getAttribute('pid');
/*const parrentScript = currentScript.parentElement;*/
if(!pidAttribute || pidAttribute == '' || !document.getElementById(pidAttribute)){
	let parrentBlock = document.createElement('div');
	document.body.appendChild(parrentBlock);
	parrentBlock.id = `advocatetravelanimationscene`;
	pidAttribute =	parrentBlock.id;
	parrentBlock.style.position = `absolute`;
	parrentBlock.style.display = `flex`;
	parrentBlock.style.flexDirection = `row`;
	parrentBlock.style.justifyContent = 'center';
	parrentBlock.style.alignItems = 'center';
	parrentBlock.style.bottom = '0';
	parrentBlock.style.width = `100vw`;
	parrentBlock.style.height = `50vh`;
}
const parrentScript = document.getElementById(pidAttribute);
var arrTask = [];
var numTask = -1;
var pw = 0;
var ph = 0;
var pmax = 0;
var pmin = 0;
const scene = document.createElement('div');
const scenePerson = document.createElement('div');
const task = document.createElement('div');
const MyRandomNumber=()=>{return Math.floor(Math.random() * 1000);};
const getRandomNumber=(min, max)=>{return Math.floor(Math.random() * (max - min + 1)) + min;};
const delay = (interval)=>{return new Promise(function(resolve){setTimeout(resolve, interval);});}; 
const LoadGoals=(filelink)=>{fetch(`${filelink}`).then(response => response.json()).then(data => {
	arrTask  = JSON.parse(JSON.stringify(data));
	MakingScene();
}).catch(error => console.error(error));};
const MakingScene = function(){
	if(document.getElementById("scene_lawyertravel")){document.getElementById("scene_lawyertravel").remove();};
   parrentScript.innerHTML = ``;
	parrentScript.appendChild(scene);
	if(centrScriptAttribute == `1`){
		parrentScript.style.display = 'flex';
		parrentScript.style.flexDirection = `row`;
		parrentScript.style.justifyContent = `center`;
		parrentScript.style.alignItems = `center`;
	};
	scene.style.width = '100%';	
	scene.style.height = '100%';
	if(parrentScript.offsetWidth/(16/9)>parrentScript.offsetHeight){scene.style.width = `${parrentScript.offsetHeight * (16/9)}px`;} else {scene.style.height = `${parrentScript.offsetWidth / (16/9)}px`;};
	scene.id = `scene_lawyertravel`;
	scene.style.position = `relative`;
	scene.style.margin = `0`;
	scene.style.padding = `0`;
	scene.style.boxSizing = `border-box`;
	/*
		scene.style.background = `linear-gradient(to bottom,rgba(150, 200, 230, 0.94) 0%, rgba(180, 220, 255, 0.96) 50%, rgba(240, 250, 250, 0.98) 100%)`;
		scene.style.background = `linear-gradient(to bottom,rgba(220, 220, 220, 0.94) 0%, rgba(230, 230, 230, 0.96) 50%, rgba(255, 255, 255, 0.98) 100%)`;
	*/		
	scene.style.background = `linear-gradient(to bottom,rgba(230, 230, 230, 0.99) 0%, rgba(230, 230, 230, 0.99) 50%, rgba(230, 230, 230, 0.99) 100%)`;
	/*
	parrentScript.style.backgroundImage = `url(data:image/jpeg;${new Date().getTime()};base64,${Kurort_jpg})`;
	parrentScript.style.backgroundSize = `${scene.offsetWidth}px ${scene.offsetHeight}px`;
	parrentScript.style.backgroundRepeat = `no-repeat`;
	parrentScript.style.backgroundPosition = `center`;
	*/
	pw = scene.offsetWidth;
	ph = scene.offsetHeight;
	pmax = (pw>=ph)?pw:ph;
	pmin = (pw<=ph)?pw:ph;
	ThrowThing(TaskMove());
};
const TaskMove = function(){
	if(numTask < arrTask.length-1)numTask++;else numTask = 0;
	let x = 0;
	let y = 0;
	if(document.getElementById("task_lawyertravel")){document.getElementById("task_lawyertravel").remove();};
	scene.appendChild(task);
	task.style.transition = '';
	task.style.position = 'absolute';
	task.id = `task_lawyertravel`;
	task.style.display = `flex`;
	task.style.justifyContent = 'center';
	task.style.alignItems =  'center';
	task.style.padding = 10*(pmin * 0.01)+'px';
	task.style.maxWidth = `95%`;
	task.style.maxHeight = `95%`;
	task.style.fontSize = `${0.07*pmin}px`;
	/*task.style.backgroundColor = '#334145';*/
	const colors = ["#A0ABBA", "#668290", "#405060", "#334145"];task.style.background = `radial-gradient(circle, ${colors.join(",")})`;
	task.style.color = 'yellow';
	task.style.opacity = '0';
	task.style.borderRadius = '10px';
	task.innerHTML = arrTask[numTask].content;
	task.style.whiteSpace = `nowrap`;
	do {
		x = getRandomNumber(- task.offsetWidth, scene.offsetWidth + task.offsetWidth);
		y = getRandomNumber(- task.offsetHeight, scene.offsetHeight / 2);
	} while (x > 0 && y > 0);
	task.style.transition = ``;
	task.style.transform = `scale(${0})`;
	task.style.left = `${x}px`;
	task.style.top =  `${y}px`;
	delay(20).then(()=>{
		task.style.opacity = '1';
		task.style.transition = `opacity ${Math.random() * 0.8 + 0.2}s ease-out,  left ${Math.random() * 0.8 + 0.2}s ease-in-out,  top ${Math.random() * 0.8 + 0.2}s ease-in-out, transform ${Math.random() * 0.8 + 0.2}s ease-in-out`;
		delay(10).then(()=>{
			task.style.left = `${50 * (pw*0.01) - (task.offsetWidth / 2) }px`;
			task.style.top = `${40 * (ph*0.01) - (task.offsetHeight / 2) }px`;
			task.style.transform = `scale(${1})`;
		});
	});
	return arrTask[numTask].thing;
};
const ThrowThing = (var_name)=>{
	const NextTask = (babah)=>{
		delay(2000).then(()=>{
			if(babah == 3){
				task.style.opacity = '0';
				task.style.backgroundImage = `url(data:image/svg+xml;${new Date().getTime()};base64,${btoa(Hrest_svg)})`;
				task.style.backgroundSize = `contain`;
				task.style.backgroundRepeat = `no-repeat`;
				task.style.backgroundPosition = `center`;   
				parrentScript.style.backgroundImage = ``;
				delay(250).then(()=>{
					parrentScript.style.backgroundImage = `url(data:image/gif;${new Date().getTime()};base64,${Kurort_gif})`;
					parrentScript.style.backgroundSize = `${scene.offsetWidth}px ${scene.offsetHeight}px`;
					parrentScript.style.backgroundRepeat = `no-repeat`;
					parrentScript.style.backgroundPosition = `center`;
					scene.style.backgroundImage = `url(data:image/gif;${new Date().getTime()};base64,${Vybuh_gif})`;
					scene.style.backgroundSize = `200%`;
					scene.style.backgroundRepeat = `no-repeat`;
					scene.style.backgroundPosition = `50% 35%`;
					delay(1000).then(()=>{
						ThrowThing(`1000`);
					});
				});
			} else if (babah == 1000){
				delay(500).then(()=>{
					delay(1000).then(()=>{
						/*
						parrentScript.style.backgroundImage = `url(data:image/jpeg;${new Date().getTime()};base64,${Kurort_jpg})`;
						parrentScript.style.backgroundSize = `${scene.offsetWidth}px ${scene.offsetHeight}px`;
						parrentScript.style.backgroundRepeat = `no-repeat`;
						parrentScript.style.backgroundPosition = `center`;
						*/
						/*scene.style.background = `linear-gradient(to bottom,rgba(150, 200, 230, 0.94) 0%, rgba(180, 220, 255, 0.96) 50%, rgba(240, 250, 250, 0.98) 100%)`;*/
						scene.style.background = `linear-gradient(to bottom,rgba(230, 230, 230, 0.99) 0%, rgba(230, 230, 230, 0.99) 50%, rgba(230, 230, 230, 0.99) 100%)`;
						parrentScript.style.backgroundImage = '';
						ThrowThing(TaskMove());
					});
				});			
			} else {
				task.style.opacity = '0';
				task.style.backgroundImage = `url(data:image/svg+xml;${new Date().getTime()};base64,${btoa(Hrest_svg)})`;
				task.style.backgroundSize = `contain`;
				task.style.backgroundRepeat = `no-repeat`;
				task.style.backgroundPosition = `center`;   
				delay(1000).then(()=>{
					ThrowThing(TaskMove());
				});
			};
		});
	};
	if(document.getElementById("person_lawyertravel")){document.getElementById("person_lawyertravel").remove();};
	scene.appendChild(scenePerson);
	scenePerson.id = `person_lawyertravel`;
	scenePerson.style.position = 'absolute';
	scenePerson.style.left = `${0}px`;	
	scenePerson.style.top = `${0}px`;
	scenePerson.style.width = `${scene.offsetWidth}px`;
	scenePerson.style.height = `${scene.offsetHeight}px`;
	switch (var_name) {
		case '0':
			scenePerson.innerHTML = `${ThrowPapka_svg1}`;
			NextTask(var_name);
			break;
		case '1':
			/*scene.style.backgroundImage = `url(data:image/gif;${new Date().getTime()};base64,${ThrowPaper_gif})`;*/
			scenePerson.innerHTML = `${ThrowPaper_svg1}`;			
			NextTask(var_name);
			break;
		case '2':
			scenePerson.innerHTML = `${ThrowCase_svg1}`;
			NextTask(var_name);
			break;
		case '3':
			scenePerson.innerHTML = `${ThrowBootle_svg1}`;
			NextTask(var_name);
			break;
		case '1000':
			scenePerson.innerHTML = `${Happy_svg}`;
			scenePerson.style.width = `${scene.offsetWidth * 0.5}px`;
			scenePerson.style.height = `${scene.offsetHeight * 0.5}px`;
			scenePerson.style.left = `${25 * (pw * 0.01)}px`;
			scenePerson.style.top = `${50 * (ph * 0.01)}px`;
			NextTask(var_name);
		break;
		default:
			break;
	};
};
